<template>
	<view class="content">
		<view class="uni-padding-wrap uni-common-mt">
			<view class="portrait-box">
				<imageWrapper ref="imageWrapper" :imgBg="imgBg" :maskImg="maskImg" :frame="frame">
					<view class="text" v-if="slots">
						头像
					</view>
				</imageWrapper>
			</view>
			<view class="imgSelect">
				<view class="selBtn" @click="setBg()">
					添加背景
				</view>
				<view class="selBtn" @click="setDec()">
					添加装饰
				</view>
				<view class="selBtn" @click="setFrame()">
					添加相框
				</view>
			</view>
			<!-- <img src="" alt="" class="imgSmall"> -->
			<view class="editBtn" @click="toImage">
				合成
			</view>
			<block v-if="newImg">
				<view id="Generated">
					<img class="imgs" :src="newImg" alt="">
					<view>长按保存图片</view>
				</view>
			</block>
		</view>
	</view>
</template>

<script>
	var html2canvas = require("@/common/html2canvas.min.js");
	import imageWrapper from '@/components/image-wrapper.vue'
	export default {
		data() {
			return {
				base64Img: "",
				imgBg: "",
				maskImg: [],
				newImg: "",
				frame: "",
				"slots": false,
				loading: false
			}
		},
		onLoad() {},
		onShow() {
			//this.getBase64Image();
		},
		components: {
			imageWrapper
		},
		methods: {
			setBg() {
				var that = this;
				var bg =
					"data:image/jpeg;base64,";
				this.imgBg = bg;
			},
			setDec() {
				var that = this;
				var dec =
					"data:image/png;base64,";
				that.maskImg.push(dec);
			},
			setFrame() {
				var that = this;
				var f =
					"data:image/png;base64,";
				that.frame = f;
			},
			toImage() {
				var that = this;
				if (that.loading) {
					return false
				}
				var obj = document.getElementById("ImageWrapper");
				var width = obj.offsetWidth;
				var height = obj.offsetHeight;
				that.loading = true;
				uni.showLoading({
					title: "正在生成..."
				})
				html2canvas(obj, {
					backgroundColor: null,
					allowTaint: true,
					tainttest: true,
					width: width,
					height: height
				}).then((canvas) => {
					that.loading = false;
					uni.hideLoading()
					let dataURL = canvas.toDataURL("image/png");
					console.log(dataURL)
					this.newImg = dataURL;
				});
			},
			getBase64Image() {
				var that = this;
				var img = new Image();
				img.src = that.dataURL;
				img.onload = function() {
					var canvas = document.createElement("canvas");
					canvas.width = img.width;
					canvas.height = img.height;
					var ctx = canvas.getContext("2d");
					ctx.drawImage(img, 0, 0, img.width, img.height);
					var ext = img.src.substring(img.src.lastIndexOf(".") + 1).toLowerCase();
					var dataURL = canvas.toDataURL("image/" + ext);
					that.base64Img = dataURL;
					console.log(dataURL);
					return dataURL;
				}
			}
		}
	}
</script>

